review:
Membeli beberapa unit tapi saya tidak merekomendasikan karena berikut ini:
-Penglihatan malam yang buruk seperti yang ditunjukkan pada video (lihat video terlampir);
-Tidak ada pemutaran. Semua unit tidak memiliki pemutaran. Anda harus membuka kamera secara harafiah dan mendapatkan kartu sd untuk bermain di komputer Anda (lihat gambar);
-Penjual mengklaim bahwa itu karena kartu sd dan janji untuk memberikan penggantian pada pesanan berikutnya tetapi setelah menerima pesanan kedua tidak ada kartu SD.
